import { Card, Stack, Text } from "@chakra-ui/react";
import StarIcon from "./icons/Star";

const FaqCard = () => {
  return (
    <Card
      style={{
        width: "50%",
        height: "60vh",
        marginTop: "-10%",
        borderRadius: "16px",
        boxShadow:
          "0 4px 8px 0 rgba(0, 0, 0, 0.2), 0 6px 20px 0 rgba(0, 0, 0, 0.19)",
      }}
    >
      <Stack sx={{
        display: "flex",
        flexDirection: "row",
        alignItems: "center",
        p: "2.5em"
      }}>
        <StarIcon />
        <Text style={{ fontSize: "56px", fontWeight: "700" }}>FAQs</Text>
      </Stack>
    </Card>
  );
};

export default FaqCard;
